import React from 'react';
import '../App.css';
import img from './python-logo.png'


const Header = () => {
  return (
    <div className="header">
      <img src={img} alt="" />
      <nav className="nav_bar">
        <a href="#">Home</a>
        <a href="#">Courses</a>
        <a href="#">Tasks</a>
      </nav>
    </div>
  );
}

export default Header;
